import { EmailInfo } from '@/api/extend/email'
import DetailMain from './DetailMain'
export default {
  name: 'emailDetail',
  components: { DetailMain },
  data() {
    return {
      isSend: false,
      dataForm: {},
      loading: false
    }
  },
  created() {
    this.init()
  },
  methods: {
    goBack() {
      this.$emit('close')
    },
    init() {
      this.loading = true
      let id = this.$route.query.id
      if (id) {
        EmailInfo(id).then(res => {
          this.dataForm = res.data
          this.loading = false
        })
      }
    }
  }
}
